    false,nt"url": null,nt"notes": "This dataset is a compilation of wellheader
    features in the state of Wisconsin, compiled by the Wisconsin Geological and Natural
    History Survey and published as a Web feature service, a web map service, an ESRI
    service, and as a downloadable Excel spreadsheet for the National Geothermal Data
    System. The document contains 8 worksheets, including information about the template,
    notes related to revisions of the template, Resource provider information, the data,
    a field list (data mapping view) and a worksheet with vocabularies for use in populating
    the spreadsheet (data valid terms).  Fields in the data table include HeaderURI,
    WellName , APINo, Label, OtherID, and InformationSource.",nt"license_title":
